import { useState, useEffect } from "react";
import axios from 'axios';
// import { API_URL, TRAIL_ENDPOINT } from "../services/auth.constants";

const BASE_URL = 'https://8000-mkrs90-wildsteppebacken-vpz7io4uhwz.ws-us94.gitpod.io/api';

export default function TrailPage() {
    const [trailDetails, setTrailDetails] = useState([]);

    useEffect(() => {
        const getTrailDetails = async () => {
            let config = {
                url: '/trails/',
                baseURL: BASE_URL,
                method: 'get'
            }
            let response = await axios.request(config);
            console.log(response);
            setTrailDetails(response.data);
        }
        getTrailDetails();
    }, [])


    return (
        <div className="container border">
            <p>Trail Page</p>
            <div><TrailDetailCard trailDetail={trailDetails} /></div>


        </div>
    )
}

export const TrailDetailCard = ({ trailDetail }) => {
    return (
        <>
            <div className="card text-center" style={{ width: '18rem' }}>
                <img src="..." className="card-img-top" alt="..." />
                <div className="card-body">
                    <h5 className="card-title">{trailDetail.id}</h5>
                </div>
            </div>
        </>
    )
}
